import "./about.css";
import TypeWriter from "typewriter-effect";

const About = () => {
  return (
    <div className="a">
      <div className="a-right">
        <h1 className="a-title">About Me</h1>
        <p className="a-sub">
          {" "}
          <TypeWriter
            onInit={(typewriter) => {
              typewriter
                .typeString("From Traditional Finance")
                .pauseFor(2000)
                .typeString(", To The DeFi Future")
                .pauseFor(2000)
                .start();
            }}
            options={{
              autoStart: true,
              loop: true,
              changeDeleteSpeed: 1,
            }}
          />
        </p>
        <p className="a-desc">
          Previously worked in an international bank as management trainee. Have
          a deep understand of how the traditional financial services
          institutions work in modern society. Interest investment blog writer.
          Now equipping myself towards the DeFi world as smart contract
          developer in Cardano ecosystem.
        </p>
        <div className="a-award">
          <h3 className="a-award-title">Academic Records</h3>
          <p className="a-award-texts">
            Renowned University First Class Honour Graduate
          </p>
          <p className="a-award-texts">Dean's List in all academic years</p>
          <p className="a-award-texts">
            Multiple Business Case Competition Awards
          </p>
        </div>
      </div>
      <div className="a-left">
        <div className="a-card bg"></div>
        <div className="a-card">
          <img src={Hinson} alt="" className="a-img" />
        </div>
      </div>
    </div>
  );
};

export default About;
